    true,nt"url": null,nt"notes": "The Federal Labor Management Information
    System (FLIS) is a database containing current information on labor-management relations
    in the Federal Government. Currently, it includes representational data on all bargaining
    units certified by the Federal Labor Relations Authority (FLRA) in accordance with
    chapter 71 of title 5, United States Code, including the name, description, location,
    member population and affiliation of each bargaining unit in the federal sector
    and the Agency whose employees they represent.",nt"license_title": "U.S. Government
